import React from 'react';
import logo from './logo.svg';
import './App.css';

function SocialNetworkSite() {
  return (
    <div className='SNsite'>
      <Header />
      <LeftMenu />
      <MainBlock />
    </div>
  );
}


function Header() {
  return (
    <div className='header'>
      <div className='header__logo'>
        <img src='http://www.pngall.com/wp-content/uploads/2016/06/Superman-Logo-Free-Download-PNG.png'/>
      </div>
      <div className='header__button'>
        <button>Выход</button>
      </div>
    </div>
  )
}

function LeftMenu() {
  return (
    <ul className='menu'>
      <li>Profile</li>
      <li>Messages</li>
      <li>News</li>
      <li>Music</li>
      <li>Settings</li>
    </ul>
  )
}

function MainBlock() {
  return(
    <div className='main'>
      <img src='http://dgdesign.ru/uploads/posts/2018-05/1525700405_shapka-sayta-tehnologii-2114654127851.jpg' />
      <div className='user'>
        <div className='user__avatar'>
          <img src='https://clraik.com/forum/customavatars/avatar14341_15.gif'/>
        </div>
        <div className='user__info'>
          <h4>Kirill S.H</h4>
          <p>Date of Birth: <span>12.08.1994 g.</span></p>
          <p>City: <span>Belogorod</span></p>
          <p>Education: <span>Belgorod economic university</span></p>
          <p>Date of Birth: <span>12.08.1994 г.</span></p>
        </div>
      </div>
    </div>
  )
}
export default SocialNetworkSite;
